webpackJsonp([0xbbffb77209f4],{526:function(e,a){e.exports={data:{markdownRemark:{html:'<p>HackerOne offers a bi-directional Jira integration that syncs information between your HackerOne report and the Jira issue. You can choose to integrate with Jira Cloud or Jira Server. </p>\n<p>To integrate with Jira Server:</p>\n<ol>\n<li>\n<p>Go to <strong>Settings > Program > Integrations</strong>.</p>\n</li>\n<li>\n<p>Click the <strong>Connect with JIRA</strong> link.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-326ad.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 8.739255014326648%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAACCAYAAABYBvyLAAAACXBIWXMAABYlAAAWJQFJUiTwAAAAVUlEQVQI13WMQQ6AMAgE+/+nmkhASrVFu9Ke7EGSzWyyZJJawcYF43rvk8UMzAxVhYjA/V72b3+C+awzWiqSe4vSlifLGbTvU0pEIfRf4eBhFyQy+AKWGZzJ0lfT9QAAAABJRU5ErkJggg==\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jira-server-1"\n        title=""\n        src="/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-e7ffa.png"\n        srcset="/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-49813.png 125w,\n/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-dc8a5.png 250w,\n/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-e7ffa.png 500w,\n/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-dda24.png 750w,\n/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-c5f18.png 1000w,\n/docs.hackerone.com/static/jira-server-1-750c2d895bec403fb97069a27ca6d9b9-326ad.png 1396w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n</li>\n<li>\n<p>Choose <strong>JIRA Server</strong>, and you\'ll be redirected to this 4-step setup screen where you can configure your Jira integration.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/jira-server-3-e570911e1a0dafd8cd591809f78ac120-0ce80.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 496px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.56451612903226%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jira-server-3"\n        title=""\n        src="/docs.hackerone.com/static/jira-server-3-e570911e1a0dafd8cd591809f78ac120-c0270.png"\n        srcset="/docs.hackerone.com/static/jira-server-3-e570911e1a0dafd8cd591809f78ac120-28d5f.png 125w,\n/docs.hackerone.com/static/jira-server-3-e570911e1a0dafd8cd591809f78ac120-47746.png 250w,\n/docs.hackerone.com/static/jira-server-3-e570911e1a0dafd8cd591809f78ac120-c0270.png 500w,\n/docs.hackerone.com/static/jira-server-3-e570911e1a0dafd8cd591809f78ac120-d97c0.png 750w,\n/docs.hackerone.com/static/jira-server-3-e570911e1a0dafd8cd591809f78ac120-0ce80.png 992w"\n        sizes="(max-width: 496px) 100vw, 496px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-a784b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 76.52645861601086%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jira-server-2"\n        title=""\n        src="/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-e7ffa.png"\n        srcset="/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-49813.png 125w,\n/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-dc8a5.png 250w,\n/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-e7ffa.png 500w,\n/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-dda24.png 750w,\n/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-c5f18.png 1000w,\n/docs.hackerone.com/static/jira-server-2-41203532d0e8b46e3418ae97cb07c049-a784b.png 1474w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n</li>\n<li>\n<p>Enter the URL of the Jira instance you want to authenticate with in the <strong>Instance base URL</strong> field in the <strong>Configure an Application Link</strong> step.</p>\n</li>\n<li>\n<p>Click the <strong>Authenticate with JIRA</strong> button to finalize the set up between HackerOne and your Jira instance.  </p>\n</li>\n<li>\n<p><em>(Optional)</em> Configure which HackerOne reports you\'d like to escalate to Jira in the <strong>Configure HackerOne to JIRA escalation</strong> window.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/jira-server-4-09ca3e38de9d76b185462fd994a20623-c053e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.7843665768194%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jira-server-4"\n        title=""\n        src="/docs.hackerone.com/static/jira-server-4-09ca3e38de9d76b185462fd994a20623-e7ffa.png"\n        srcset="/docs.hackerone.com/static/jira-server-4-09ca3e38de9d76b185462fd994a20623-49813.png 125w,\n/docs.hackerone.com/static/jira-server-4-09ca3e38de9d76b185462fd994a20623-dc8a5.png 250w,\n/docs.hackerone.com/static/jira-server-4-09ca3e38de9d76b185462fd994a20623-e7ffa.png 500w,\n/docs.hackerone.com/static/jira-server-4-09ca3e38de9d76b185462fd994a20623-c053e.png 742w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n</li>\n<li>\n<p><em>(Optional)</em> Select which Jira actions you\'d like to post onto HackerOne in the <strong>Select JIRA to HackerOne events</strong> window. You can choose from:</p>\n</li>\n</ol>\n<table>\n<thead>\n<tr>\n<th>Option</th>\n<th>Detail</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Status changed</td>\n<td>Post an internal comment when an issue changes status.</td>\n</tr>\n<tr>\n<td>Resolution changed</td>\n<td>Post an internal comment when an issues changes resolution.</td>\n</tr>\n<tr>\n<td>Priority changed</td>\n<td>Post an internal comment when an issues changes priority.</td>\n</tr>\n<tr>\n<td>Assignee changed</td>\n<td>Post an internal comment when an issue changes assignee.</td>\n</tr>\n<tr>\n<td>Comment added</td>\n<td>Post an internal comment when someone comments on an issue.</td>\n</tr>\n</tbody>\n</table>\n<p>   \n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/jira-server-5-499eb22c64fcbfda1aef077541e49937-7b60b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.53020134228188%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jira-server-5"\n        title=""\n        src="/docs.hackerone.com/static/jira-server-5-499eb22c64fcbfda1aef077541e49937-e7ffa.png"\n        srcset="/docs.hackerone.com/static/jira-server-5-499eb22c64fcbfda1aef077541e49937-49813.png 125w,\n/docs.hackerone.com/static/jira-server-5-499eb22c64fcbfda1aef077541e49937-dc8a5.png 250w,\n/docs.hackerone.com/static/jira-server-5-499eb22c64fcbfda1aef077541e49937-e7ffa.png 500w,\n/docs.hackerone.com/static/jira-server-5-499eb22c64fcbfda1aef077541e49937-7b60b.png 745w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="8">\n<li><em>(Optional)</em> Select which actions in HackerOne you\'d like to post to Jira in the <strong>Select HackerOne to JIRA events</strong> window. You can choose from:</li>\n</ol>\n<table>\n<thead>\n<tr>\n<th>Option</th>\n<th>Detail</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Comments</td>\n<td>When someone comments on a report, post an update on the associated Jira issue.</td>\n</tr>\n<tr>\n<td>State Chagnes</td>\n<td>When someone changes the state of a report, post an update on the associated Jira issue.</td>\n</tr>\n<tr>\n<td>Rewards</td>\n<td>When someone awards or suggests a bounty and/or bonus, post an update on the associated Jira issue.</td>\n</tr>\n<tr>\n<td>Assignee Changes</td>\n<td>When someone assigns a user/group to a report, post an update on the associated Jira issue.</td>\n</tr>\n<tr>\n<td>Public Disclosure</td>\n<td>When public disclosure is requested or a report becomes public, post an update on the associated Jira issue.</td>\n</tr>\n</tbody>\n</table>\n<p>   \n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/jira-server-6-51ecdea0a9470fb0554d50939ff0330a-7b60b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.39597315436242%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jira-server-6"\n        title=""\n        src="/docs.hackerone.com/static/jira-server-6-51ecdea0a9470fb0554d50939ff0330a-e7ffa.png"\n        srcset="/docs.hackerone.com/static/jira-server-6-51ecdea0a9470fb0554d50939ff0330a-49813.png 125w,\n/docs.hackerone.com/static/jira-server-6-51ecdea0a9470fb0554d50939ff0330a-dc8a5.png 250w,\n/docs.hackerone.com/static/jira-server-6-51ecdea0a9470fb0554d50939ff0330a-e7ffa.png 500w,\n/docs.hackerone.com/static/jira-server-6-51ecdea0a9470fb0554d50939ff0330a-7b60b.png 745w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>You\'re all set! Now that you\'ve finished setting up the Jira integration, you can create Jira issues right from your HackerOne report. </p>',frontmatter:{path:"/programs/jira-server-integration.html",id:"programs/jira-server-integration",title:"Jira Server Integration"}}},pathContext:{}}}});
